import React from "react";
import ReactDOM from "react-dom";

import { jsx } from "theme-ui";
function MainPage() {
  return (
    <div
      sx={{
        pl: [1, 2, 3],
        pr: [1, 2, 3],
        pt: [1, 2, 3],
        pb: 1,
        display: "flex",
        flexDirection: "column",
        // minHeight: '100vh',
        height: "100%",
        width: "100%",
        background: "#E7B996",
      }}
    >
      HELLO
    </div>
  );
}

export default MainPage;
